import axios from "axios";
import { useEffect, useState } from "react";

interface User {
	id:			number;
	email:		string;
	firstName?:	string;
	lastName?:	string;
	userName?:	string;
}

function getAllUsers(setDisplay) {
	axios('http://localhost:3001/user')
	.then((res) => {
		console.log(res);
		setDisplay(res.data);
	})
}

const App:React.FC = () =>
{
	const [display, setDisplay] = useState<User[]>([]);
	// const res = getUsers();
	// var data: Array<User> = [];
	useEffect(() => {
		getAllUsers(setDisplay);
	}, []);
	// getAllUsers();

	return (
		<div> 
			<h1>These are all the Users!</h1>
			{display.map((element) => {return (<p>{element.email}</p>)})}
		</div>
	);
}

export default App;
